import './QrCode.styles.css';

import _QRCodeStyling from 'qr-code-styling';
import { memo, useEffect, useMemo, useState } from 'react';

const QRCodeStyling = _QRCodeStyling as unknown as typeof _QRCodeStyling.default;

type Props = {
  value: string;
  size: number;
};

export const QrCode = memo(({ value, size }: Props) => {
  const [ref, setRef] = useState<HTMLDivElement | null>(null);
  const qrCode = useMemo(() => {
    return new QRCodeStyling({
      data: value,
      type: 'svg',
      shape: 'square',
      width: size,
      height: size,
      margin: 0,
      // image: `data:image/png;base64,${IMAGE}`,
      imageOptions: {
        hideBackgroundDots: true,
        imageSize: 0.4,
        margin: 4,
      },
      dotsOptions: {
        type: 'square',
        color: '#ffffff',
      },
      backgroundOptions: {
        color: 'transparent',
      },
      cornersSquareOptions: {
        type: 'dot',
        color: '#ffffff',
      },
      cornersDotOptions: {
        type: 'dot',
        color: '#ffffff',
      },
      qrOptions: {
        errorCorrectionLevel: 'M',
      },
    });
  }, [size]);

  useEffect(() => {
    if (ref) {
      qrCode.append(ref);
    }

    return () => {
      if (ref) {
        QRCodeStyling._clearContainer(ref);
      }
    };
  }, [qrCode, ref]);

  useEffect(() => {
    qrCode?.update({ data: value });
  }, [value, qrCode]);

  return <div className="papp-qr-code-container" style={{ height: size, width: size }} ref={setRef} />;
});

